import axios from 'axios';
import { useState, useEffect } from 'react';

function Results() {
  const [isLoading, setIsLoading] = useState(false);
  const [data, setData] = useState([]);

  useEffect(async () => {
    try {
      setIsLoading(true);
      const { data } = await axios.post('/api/airbnb', {
        url: 'airbnb.com/abc',
      });
    } catch (error) {
      console.error(error);
    }
    if (data) {
      setData(data);
    }
    setIsLoading(false);
  }, []);

  return <div>Test</div>;
}

export default Results;
